import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="app">
      <TrendingSection />
      <TopicSection title="Topic One" />
      <TopicSection title="Topic Two" />
      {/* ... other topics if needed */}
    </div>
  );
};

const TrendingSection = () => {
  return (
    <div className="trending-section">
      <h2>Trending</h2>
      {/* You would map through an array of trending topics here */}
      <ArticleCard />
      <ArticleCard />
      {/* ... */}
    </div>
  );
};

const TopicSection = ({ title }) => {
  return (
    <div className="topic-section">
      <h2>{title}</h2>
      {/* You would map through an array of articles here */}
      <ArticleCard />
      <ArticleCard />
      <ArticleCard />
      {/* ... */}
    </div>
  );
};

const ArticleCard = () => {
  return (
    <div className="article-card">
      <h3>Lorem ipsum dolor sit amet.</h3>
      <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit...</p>
      <span>2 mins read</span>
    </div>
  );
};

export default App;
